      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 IN ( col1, 66, + - col2 - - col1, col1 * + 49 + - 36, - col2, - + col2 * ( + ( - col1 ) ) - - CAST ( NULL AS INTEGER ) * - 53 );
  - name: tab0

outputs:
  - name: q8650.out
    data: |
